@Alberto Mejias gracias..... pero principalmente estoy desconcertado por el rumbo que tomo este sano ejercicio democrático de crear la nueva  carta Magna, cuando partimos teníamos como referentes a Alemania, Suecia y New Zelanda y hoy en día,  nuestros referentes son Bolivia y Venezuela.... es preocupante. 

Los entendidos en constitucionalidad  siempre dicen que las mejores y más duraderas cartas magna deberían ser minimalistas y cortas como las europeas  pero la Chilena si se aprueba,  seria la más MAXIMALISTA Y LARGA  del mundo  como ejemplo (mal ejemplo  a seguir) las constituciones más maximalistas y largas son entre otras las de Bolivia, Nicaragua, Venezuela...... justo las que avalan y apoyan gobiernos autoritarios con cuestionable democracia.

RECHAZO TOTAL, Saludos

@Alberto Mejias concuerdo .....  tanta ideología en política hace imposible visibilizar una salida racional y cuerda . La plurinacionaludad y los 'derechos exacerbados de los indígenas solo quiebra más aún el país..... la discriminación positiva aunque beneficie a un sector sigue siendo discriminación. 
Es verdad que en muchos casos se ha maltrato al pueblo indígena por ejemplo a los pueblos Reches o mapuche en el contexto de la colonización y de alguna forma se les deve recompensar, pero todos olvidan que los Reches o Mapuches hicieron lo mismo,  peor aun quitando tierras matando a hombres y llevándose las mujeres de otras etnias cuando los Reches colonizaron Chile cruzando por la pampa Argentina.  Entre ellos Pampas Payas y Alacalufes, (les tendremos que restituir terrenos también a estas etnias dominadas por los mapuches)  recordemos que la única culturalidad de los mapuches era ser unos combatientes fieros de hecho sus tácticas aún se estudian y enseñan en la academia de guerra, su sistema político era muy básico clanes familiares que incluso  peleaban entre sí, solo se unían si había que pelear con otra etnia ( los Reches o Mapuches  dominaron a los  Incas que llegaron a Chile, no fueron los españoles .  Eran solo recolectores y cazadores, su construcción era muy básica pero muy doctos en guerra .

Chile nació desde varias naciones y mestizaje en el sur con los Aotniken Tehuelches kaweskar y Patagones Mapuches  y norte Diaguitas Aymaras  Atacameños  entre otros pueblos originarios y por supuesto españoles...... a partir de estas diferentes etnias o pequeñas naciones se creó la República de Chile , volver a disgregar y separar esta nación es retroceder 200 años a la época de la colonia un sinsentido ridículo encuentro.

