Ni Incas ni mapuches tienen derecho a tierras solo por su apellido. Pinochet ya les devolvió miles de hectáreas a todo mapuche que demostrara que poseyó tierras y puso como condición que estas no podían ser vendidas. Fue Aylwin quien quito esa condición, y que paso? Fácilmente 3/4 de los mapuches vendió por cientos de millones sus hectáreas para darse la gran vida. Hoy décadas después sus hijos y nietos se dan cuenta que esas mismas tierras que vendió su antepasado valen el doble o triple así que las quieren de vuelta. Aquí no hay deudas pendientes, simplemente un carerajizmo nacido de la ignorancia y nacer mapuche no es excusa para serlo.

